intro:
Lâu rồi mới có dịp vào lại SG nên gọi cho 1 em hồi trước hay gặp;

Cũng tâm sự hẹn hò và dắt díu nhau vào khách sạn như thuở nào; 1 nháy phê người;

Vếu to và vẫn xinh như ngày nào. Dịch vụ bú mút vẫn đầy đủ và yêu nghề như ngày đầu.

Một số hình cho anh em thị dâm, à số của em nó: không chín 03 bảy bảy chín…. Để ý chút là có số nhé các đồng dâm.

Chào thân ái.

PS: giá 300k/s; pass: bạn a Kiệt nhé
